(277, '_transient_0c6cf49cd7fda42e30e04673fe52d40b', 'O:8:\"stdClass\":12:{s:11:\"new_version\";s:6:\"3.5.12\";s:14:\"stable_version\";s:6:\"3.5.12\";s:4:\"name\";s:68:\"Ninja Tables Pro - The Fastest and Most Diverse WP DataTables Plugin\";s:4:\"slug\";s:16:\"ninja-tables-pro\";s:3:\"url\";s:72:\"https://wpmanageninja.com/downloads/ninja-tables-pro-add-on/?changelog=1\";s:12:\"last_updated\";s:19:\"2020-04-07 08:57:30\";s:8:\"homepage\";s:60:\"https://wpmanageninja.com/downloads/ninja-tables-pro-add-on/\";s:7:\"package\";s:222:\"https://wpmanageninja.com/edd-sl/package_download/MTU4NzQwMzAwOTozMjAyMWNiZTY2OTA0MGQ5MzljNjg0ZjMyNmU3ZTM4NToyNzM6ZDk4ZTU4NThkMTg2MTMyYmMyNzBhNGZhN2U1ZWMxODA6aHR0cEAvLzE5ODh0YWl3YW4ucHJvOS5kZXNpZ253b3Jrcy50dy8xOTg4ZGV2OjA=\";s:13:\"download_link\";s:222:\"https://wpmanageninja.com/edd-sl/package_download/MTU4NzQwMzAwOTozMjAyMWNiZTY2OTA0MGQ5MzljNjg0ZjMyNmU3ZTM4NToyNzM6ZDk4ZTU4NThkMTg2MTMyYmMyNzBhNGZhN2U1ZWMxODA6aHR0cEAvLzE5ODh0YWl3YW4ucHJvOS5kZXNpZ253b3Jrcy50dy8xOTg4ZGV2OjA=\";s:8:\"sections\";a:2:{s:11:\"description\";s:10270:\"<p>Ninja Tables is the <strong>Best Selling</strong> WordPress table builder plugin with a user-friendly layout, easy to use settings, and enticing front-end. Build a table right from the comfort without having any coding experience. Do whatever you want - create, edit, maintain and customize. Ninja Tables is the ultimate solution for making tables for any purpose.<br />\nPremium Features<br />\nNinja Tables Pro comes with a big bucket of elegant, intuitive, advanced, and enthralling features. With more integration options, cutting-edge functionalities, and next-level configurations- you can unleash the untouched potentials of your business.</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/add-media-to-tables/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/add-media-to-tables/\" target=\"_blank\" rel=\"noopener noreferrer\">Add Media to Tables Cells</a><br />\nAdd Images and other multimedia contents to your tables with Ninja Tables Pro and make your tables more effective than ever!</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/add-custom-color/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/add-custom-color/\" target=\"_blank\" rel=\"noopener noreferrer\">Unlimited Colors in Your Tables</a><br />\nDon’t get stuck with the boring white. Color your tables according to your requirements with Ninja Tables Pro plugin.</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/google-sheets-integration/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/google-sheets-integration/\" target=\"_blank\" rel=\"noopener noreferrer\">Connect Google Sheets</a><br />\nIf you have already stored your information on Google Sheets, you can publish it effortlessly with Ninja Tables Pro.</p>\n<p>Drag and Drop Data Sorting<br />\nWith Ninja Tables Pro, you don’t have to code every single task. Just drag and drop table data and arrange them intuitively.</p>\n<p>Export-Import CSV<br />\nWhere your tables are now or where you want to export one- Ninja Tables allows you to export and import tables in seconds.</p>\n<p>Advanced Customization Features<br />\nThe advanced setting enables you with a myriad of under-the-hood functionalities to make your table more powerful.</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/woocommerce-product-table/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/woocommerce-product-table/\" target=\"_blank\" rel=\"noopener noreferrer\">WooCommerce Integration</a><br />\nGot a WooCommerce store? Connect it and turn it into a Product showcase table easily with Ninja Tables Pro.</p>\n<p>Advanced Date Sorting<br />\nSort your table data according to date added or the dates assigned to them in table columns.</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/wp-posts/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/wp-posts/\" target=\"_blank\" rel=\"noopener noreferrer\">WP Posts</a><br />\nDisplay website contents in a searchable, sortable with Ninja Tables. It supports custom posts, pages, &amp; custom post types.</p>\n<p>Add CSS Class<br />\nDon’t just rely on the default stylings. Style your tables with additional CSS classes and make them more beautiful!</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/conditional-column-formatting/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/conditional-column-formatting/\" target=\"_blank\" rel=\"noopener noreferrer\">Conditional Column Formating</a><br />\nSet conditions to your tables and highlight specific columns/rows/cells according to previously set logics.</p>\n<p>Transform Value<br />\nValue Transformation is a powerful tool that concat any column values easily into valid HTML and show as computed value.</p>\n<p>Custom Filter UI<br />\nWith this feature, users can search within a particular option. First, they will filter then they do what\'s needed.</p>\n<p>Advanced Data Filtering<br />\nCustom Search Filters is useful if you want to add a Checkbox/Radio Button to show a group of rows of your table.</p>\n<p><a href=\"https://wpmanageninja.com/ninja-tables/connect-wp-fluent-form-with-ninjatables/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\n </a><br />\n<a href=\"https://wpmanageninja.com/ninja-tables/connect-wp-fluent-form-with-ninjatables/\" target=\"_blank\" rel=\"noopener noreferrer\">Connect WP Fluent Form</a><br />\nIf you’re already using WP Fluent Form, now is the time to connect it with Ninja Tables and beautifully organize your form entries.</p>\n<p>Set Max Width for Columns<br />\nThe columns have a default width and they expand based on your input. Control the columns by setting the max width.</p>\n<p>Text Alignment<br />\nHow do you want to see the text? Center, right or left? Using this feature, you can place the text on your desired position.</p>\n<p>Colspan/Cell Merging Feature<br />\nYou can easily merge cells in tables built with NinjaTables. This is a great feature which have a significant appeal.</p>\n<p>Use Shortcode in your table cell<br />\nShortcodes give you extra benefit so that you can use the same shortcode in different places to see the same result.</p>\n<p>VIP Support<br />\nOur support is prompt, reliable, efficient, and wonderful. Whenever you face a problem and whatever it is, get to us.</p>\n<p><a role=\"button\" href=\"#\"><br />\nExplore More<br />\n</a></p>\n<p>Use Case (Demos)<br />\nNinja Tables demos are created by us to show you how the tables look after building. We have made several tables for various purposes and want to show a few models here. By seeing the demos, you can convince yourself even before you start<br />\nusing the table.</p>\n<ul>\n<li><a href=\"https://wpmanageninja.com/use-case/#product_comparison_kc\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nComparison<br />\n</a></li>\n<li><a href=\"https://wpmanageninja.com/use-case/#amazon_list_kc\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nProduct Listing<br />\n</a></li>\n<li><a href=\"https://wpmanageninja.com/use-case/#woocommerce_product_kc\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nWooCommerce<br />\n</a></li>\n</ul>\n<ul>\n<li><a href=\"https://wpmanageninja.com/use-case/#product_specification_kc\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nSpecification<br />\n</a></li>\n<li><a href=\"https://wpmanageninja.com/use-case/#league_points_kc\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nLeague Points<br />\n</a></li>\n<li><a href=\"https://wpmanageninja.com/use-case/#cryptocurrency_kc\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nCryptocurrency<br />\n</a></li>\n</ul>\n<p><a role=\"button\" href=\"https://wpmanageninja.com/ninja-tables/use-case/\" target=\"_blank\" rel=\"noopener noreferrer\"><br />\nView All Demos<br />\n</a><br />\nNinja Tables Live Example<br />\nThis is one of the big data tables we have built to exhibit how powerful the plugin is. You can quickly create, edit, and maintain a large table like this. No matter how many pages it holds, scroll through the pagination till the end.</p>\n<p>[ninja_tables id=\"32713\"]<br />\nTestimonials<br />\nUsers love Ninja Tables and they review sometimes critically - with good and bad. Read some of the selected testimonials we can brag about. Before joining, why don’t you listen to them?<br />\nFinally got a PRO<br />\n<em>I’m very satisfied with PRO features. Tried a lot of plugins, and Ninja Tables, even in free version, is much better than any other table WP plugin. Your tables are simply… clean, neat and pleasant. After a few months of free version I decided to go PRO and I don’t regret it. Great job guys!</em><strong>teoriaelektryki</strong><br />\nSuper Plugin (Pro Version)<br />\n<em>An excellent plugin, with multiple configuration and display options and high-performance rendering. The developers have clearly put a great deal of thought into this. Support is first-class. I encountered an obscure bug in sorting date fields, which was fixed promptly and courteously. Very pleased (and I don’t normally do reviews)</em> <strong>furriskey27</strong><br />\nBest table plugin around<br />\n<em>If you need a table plugin you have to get this with the pro-addon. Excellent fast support and packed full of features to make your site stand out.</em><strong>mslaiter</strong><br />\nBest wordpress data table ever!<br />\n<em>I’ve been using the free version for several months. Now I’m using the Pro version of this plugin and it works great and provides me whatever I need! Also the developer really supports the users as well. Thank you very much for developing such a valuable plugin &lt;3</em><strong>aminji</strong><br />\nAll the awesome features you need<br />\nNinja Tables brings a plethora of modern, useful, and user-centric features. And, most amazingly, it updates regularly. If you’re a pro user, you will get all the updates automatically. However, here are all under-the-hood features you can find with this table builder plugin.</p>\n<ul>\n<li>Add Media Using Ninja Tables</li>\n<li>Introducing Responsive Breakdowns</li>\n<li>WooCommerce Integration New</li>\n<li>Google Sheets Integration New</li>\n<li>WP Posts New</li>\n<li>Connect Fluent Form New</li>\n<li>Drag and Drop Table Data Re-Arrange</li>\n<li>Customized Colors</li>\n<li>Enhanced Table Styles</li>\n<li>Customized Permission</li>\n<li>VIP Support</li>\n</ul>\n<ul>\n<li>Connect Google Sheets New</li>\n<li>Conditional Column Formating New</li>\n<li>Export-Import Table New</li>\n<li>Table Inverse</li>\n<li>Striped rows</li>\n<li>Compact Table</li>\n<li>Enhanced Table Styles</li>\n<li>Easy Configuration Option</li>\n<li>Mobile Responsive Tables</li>\n<li>Optional Fixed Layout</li>\n<li>Row Hover Animation</li>\n</ul>\n<p>We are Featured in<br />\nMany renowned WordPress blogs featured Ninja Tables in their posts. Below are the few examples to give you an idea of how people think about our product and what honestly they say.</p>\n<p>Trusted by</p>\n<p>0<br />\n+</p>\n<p><strong>Websites are using Ninja Tables</strong></p>\n<p>Grab your copy of Ninja Tables TODAY!</p>\n<p><a role=\"button\" href=\"#pricing\"><br />\nBuy Now<br />\n</a></p>\n\";s:9:\"changelog\";s:6556:\"<p>=3.5.12 (Date: Apr 07, 2020)<br />\n- Fixes shortcode defaults bug.</p>\n<p>=3.5.11 (Date: Mar 23, 2020)<br />\n- Adds all tables sorting.<br />\n- Adds Jetpack lazy image compatibility.<br />\n- Adds Fluent Form meta fields to display.<br />\n- Adds cart and checkout button customization.<br />\n- Adds batch isert for CSV to avoid PHP memory issue.<br />\n- Adds filters and search to be included in Print page.<br />\n- Adds removing image option in both backend and frontend.<br />\n- Adds all chunk data loaded hook for frontend (\'ninja_table_all_chunk_loaded\'\').<br />\n- Fixes Safari ellipsis bug.<br />\n- Fixes custom CSS duplication.<br />\n- Fixes iPhone table width bug.<br />\n- Fixes inline edit caching bug.<br />\n- Fixes frontend editing focus bug.<br />\n- Fixes Fluent Form entry fetcher bug.<br />\n- Fixes global appearance settings bug.<br />\n- Fixes stackables for the latest jQuery.<br />\n- Fixes Fluent Form provider variable bug.<br />\n- Fixes conditional matching issues for sorting.<br />\n- Fixes Google CSV no results error, filter \"ninja_tables_remote_csv_timeout\".</p>\n<p>=3.5.10 (Date: Dec 27, 2019)<br />\n- Fixes stackable tables on different devices.<br />\n- Fixes stackable tables tbody color issues.<br />\n- Fixes CSV import table bug.</p>\n<p>=3.5.9 (Date: Dec 26, 2019)<br />\n- Renders styles ahead of table load.<br />\n- Improves page speed issues.<br />\n- Adds meta query filters.<br />\n- Improves print to allow customized styles.<br />\n- Improves front end editing.<br />\n- Fixes import &amp; export issues.<br />\n- Fixes Non-ASCII characters from Google Sheet issues.<br />\n- Fixes possible browser rendering issues.<br />\n- Fixes table duplicate issues.<br />\n- Fixes stackable table with expand all issues.<br />\n- Fixes iOS rendering issues.<br />\n- Fixes custom filter loading issues.<br />\n- Fixes colored table with stackables issues.<br />\n- Fixes sticky header background issue.</p>\n<p>=3.5.8 (Date: Nov 09, 2019)<br />\n- Adds plain text export support for CSV.<br />\n- Adds Non-ASCII characters support for label filtering.<br />\n- Adds dynamic table ID placeholder for custom CSS.<br />\n- Fixed Stackable table frontend editing bug.<br />\n- Fixed WooCommerce custom Buy Now button text.<br />\n- Fixed missing transform value rendering bug.<br />\n- Fixed sticky header bug.<br />\n- Fixed stackable table print issue.<br />\n- Fixed rowspan bug for paginated data.</p>\n<p>=3.5.7 (Date: Aug 28, 2019)<br />\n- All Accessibility Issues fixed so far (y)<br />\n- Google Sheet integration imroved<br />\n- SKU field added to WooCommerce integration<br />\n- Added advanced shortcode to Posts and WooCoomerce<br />\n- Added Remote SQL COnnection<br />\n- Frontend editing image disapear issue fixed<br />\n- Spinner effect for legacy mode (Configrable)<br />\n- Added Print Header and Footer<br />\n- Improvement on integrations<br />\n- Filtering issue fixed for number range<br />\n- Date format bug fixed<br />\n- Spinner effect improved<br />\n- PHP warning fixed<br />\n- Added filter and improvemts<br />\n- Number data type UX improved</p>\n<p>=3.5.5 (Date: June 20, 2019)<br />\n- Add meta query to wp-posts table type<br />\n- Add Lightbox to WooCommerce featured image<br />\n- Accessibility fix for custom filters<br />\n- Frontend editing fix<br />\n- Add Page Size change option from frontend<br />\n- Fix Multi-select filter issue<br />\n- Improving inline editing<br />\n- Added table edit link from frontend</p>\n<p>= 3.5.2 (Date: June 13, 2019) =<br />\n- Overall Improvement<br />\n- Added Woocommerce Table<br />\n- Added Image Type Data Field<br />\n- Added Built in lightbox<br />\n- Added Button Type Box<br />\n- Added Excel Formullas<br />\n- Added Many new features<br />\n- Added Inline Editing</p>\n<p>=3.4.3 ( Date: May 27, 2019 ) =<br />\n- Overall Improvement<br />\n- Sorting bug fix<br />\n- Custom Filtering improvement<br />\n- Lots of New features<br />\n- Internal Code Refactoring<br />\n- Adding more hooks for developers<br />\n- Range Filter Added</p>\n<p>=3.3.1 ( Date: March 21, 2019 ) =<br />\n- Improved table config and make it hookable<br />\n- improve asset loading<br />\n- Now the table comply with WCAG 2.1 AA<br />\n- Added entry result counter<br />\n- Fix caption for table<br />\n- Overall performance improvement<br />\n- Added Custom MySQL table integration</p>\n<p>=3.2.5 ( Date: January 25, 2019 ) =<br />\n- Overall Improvement<br />\n- Sorting bug fix<br />\n- Custom Filtering improvement<br />\n- Date Filter Fix</p>\n<p>=3.2.3 ( Date: January 19, 2019 ) =<br />\n- Improve CSV and Print Feature<br />\n- Added Option to hide heading on Responsive Drawer and Stackable Options<br />\n- Added Option to make search bar as full width<br />\n- Added option to hide empty values on responsive breakdown<br />\n- Fix Frontend editing issues<br />\n- Fix Sorting issues for manual row sorting</p>\n<p>3.2.2 ( January 16, 2018 )<br />\n* Fix Using Icon Markup in HTML Field<br />\n* Added Frontend Editing and Managing<br />\n* Add Cell level Color Customization<br />\n* Add Features for advanced Filter Customizations<br />\n* Improved Table Import Export Feature<br />\n* Added Global JS error handling. Now Ninja table will be initiazed if other plugin throw JS error on front end.<br />\n* Added Advanced Css Classes for Table rows to styling.<br />\n* Improve overall Admin UI<br />\n* Added Performance improvement to load lots of data on frontend</p>\n<p>3.1.1 ( December 26, 2018 )<br />\n* Added Stackable Table UI<br />\n* Added Default Table Configuration Option<br />\n* Fix Intro Screen<br />\n* Improve Table UI<br />\n* Improve overall Admin UI<br />\n* Editor Link bug fix for latest version of WordPress<br />\n* Added Advanced Custom Filters<br />\n* Added Cell Level shortcodes<br />\n* Added Get Parameter for Shortcode<br />\n* Added Limit and Skip</p>\n<p>= 3.0.4 ( November 23, 2018 ) =<br />\n* Added some improvements<br />\n* Licensing issue fix</p>\n<p>= 3.0.3 ( November 20, 2018 ) =<br />\n* Added Lots of Improvements<br />\n* Added Remote CSV File Connection<br />\n* Added Google Sheet Connection<br />\n* Added WP Posts Table</p>\n<p>= 2.4.0 ( Date: October 05, 2018 )<br />\n* Added Multi-Site Compatible<br />\n* Added Feature custom Filters<br />\n* Optimize for large amount of Data Tables<br />\n* Now You can add column from Table Rows Screen<br />\n* Sorting Bug fixed for undefined values<br />\n* Typo Fixed<br />\n* Estimated Work hour for this release: 120 Human hours</p>\n<p>= 2.3.2 ( Date: August 01, 2018 )<br />\n* Added New Features - URL Parameter for Filters<br />\n* Improved Filter<br />\n* Improved Data Sorting</p>\n\";}s:7:\"banners\";s:41:\"a:2:{s:4:\"high\";s:0:\"\";s:3:\"low\";s:0:\"\";}\";s:5:\"icons\";s:176:\"a:2:{s:2:\"1x\";s:68:\"https://wpmanageninja.com/wp-content/uploads/edd/2019/02/NT-prev.png\";s:2:\"2x\";s:68:\"https://wpmanageninja.com/wp-content/uploads/edd/2019/02/NT-prev.png\";}\";}', 'no'),
